import{_ as t,c as n,ah as a,o}from"./chunks/framework.BWXOFiC5.js";const u=JSON.parse('{"title":"Move the Original MSP Tenant to a New Tenant","description":"","frontmatter":{},"headers":[],"relativePath":"Documentation/HowToGuides/InstanceChanges/move-the-original-msp-tenant-to-a-new-tenant.md","filePath":"Documentation/HowToGuides/InstanceChanges/move-the-original-msp-tenant-to-a-new-tenant.md"}'),i={name:"Documentation/HowToGuides/InstanceChanges/move-the-original-msp-tenant-to-a-new-tenant.md"};function r(s,e,h,l,m,d){return o(),n("div",null,e[0]||(e[0]=[a('<h1 id="move-the-original-msp-tenant-to-a-new-tenant" tabindex="-1">Move the Original MSP Tenant to a New Tenant <a class="header-anchor" href="#move-the-original-msp-tenant-to-a-new-tenant" aria-label="Permalink to &quot;Move the Original MSP Tenant to a New Tenant&quot;">​</a></h1><h2 id="overview-and-or-objective" tabindex="-1">Overview and or Objective <a class="header-anchor" href="#overview-and-or-objective" aria-label="Permalink to &quot;Overview and or Objective&quot;">​</a></h2><p>This document is intended to walk you through the process of changing the primary MSP tenant in your ImmyBot instance. Use cases would primaraly be if the entity that is purchasing ImmyBot is going through a buyout, and you need to change Azure environemnt so you can take down the old company&#39;s Azure environment, or the company is going through a rebrand and you need to work on changing email addresses.</p><h2 id="prerequisites" tabindex="-1">Prerequisites <a class="header-anchor" href="#prerequisites" aria-label="Permalink to &quot;Prerequisites&quot;">​</a></h2><ol><li>2 MSP admins for the ImmyBot instance</li></ol><h2 id="process" tabindex="-1">Process <a class="header-anchor" href="#process" aria-label="Permalink to &quot;Process&quot;">​</a></h2><div class="info custom-block"><p class="custom-block-title">Assumptions</p><p>For the sake of this document, we are going to refer to the old tenant as Tenant A, and the new tenant as Tenant B. <br> We are also going to assume that you can create, edit and delete Deployments, Computers, Users, etc where necessary</p></div><h3 id="step-1-create-a-new-immybot-tenant-and-make-it-an-msp-tenant" tabindex="-1">Step 1. Create a new ImmyBot Tenant and make it an MSP tenant <a class="header-anchor" href="#step-1-create-a-new-immybot-tenant-and-make-it-an-msp-tenant" aria-label="Permalink to &quot;Step 1. Create a new ImmyBot Tenant and make it an MSP tenant&quot;">​</a></h3><ol><li>If you manage tenants through an integration, please use the integration to create the tenant otherwise go to <strong>Tenants</strong> &gt; <strong>New</strong> and fill out the required information.</li><li>Once the tenant is created, edit the tenant and check the box <strong>Is MSP?</strong> in the <strong>Preferences</strong> tab.</li></ol><h3 id="step-2-connect-the-new-tenant-to-the-new-azure-environment" tabindex="-1">Step 2. Connect the new tenant to the new Azure environment <a class="header-anchor" href="#step-2-connect-the-new-tenant-to-the-new-azure-environment" aria-label="Permalink to &quot;Step 2. Connect the new tenant to the new Azure environment&quot;">​</a></h3><ol><li>Edit the tenant and navigate to the Azure tab. Input the required Azure tenant ID here. There is a link on screen if you need help finding it. This should be the new Azure environment</li></ol><h3 id="step-3-move-tenant-level-deployments-maintenance-items-tags-etc" tabindex="-1">Step 3. Move tenant level deployments, maintenance items, tags, etc <a class="header-anchor" href="#step-3-move-tenant-level-deployments-maintenance-items-tags-etc" aria-label="Permalink to &quot;Step 3. Move tenant level deployments, maintenance items, tags, etc&quot;">​</a></h3><ol><li>All of these can be edited and moved via the tenant selection on each individual item.</li></ol><h3 id="step-4-move-the-msp-users-and-msp-admins-to-the-new-tenant" tabindex="-1">Step 4. Move the MSP users and MSP Admins to the new tenant <a class="header-anchor" href="#step-4-move-the-msp-users-and-msp-admins-to-the-new-tenant" aria-label="Permalink to &quot;Step 4. Move the MSP users and MSP Admins to the new tenant&quot;">​</a></h3><ol><li>Delete one user at a time, update the person object&#39;s AD External ID and then recreate the user from the person.</li><li>Delete one admin at a time, update the person object&#39;s AD External ID and then recreate the admin from the person <ol><li>This is where you utlize the second admin from the prereqs. You will need to switch to that admin, delete your admin, fix your person and then recreate your admin.</li></ol></li></ol><h3 id="step-5-move-the-computers" tabindex="-1">Step 5. Move the computers <a class="header-anchor" href="#step-5-move-the-computers" aria-label="Permalink to &quot;Step 5. Move the computers&quot;">​</a></h3><ol><li>You can batch action this from the <strong>Tenant</strong> &gt; <strong>Computer</strong> tab</li></ol><h3 id="step-6-decomm-the-old-tenant" tabindex="-1">Step 6. Decomm the old tenant <a class="header-anchor" href="#step-6-decomm-the-old-tenant" aria-label="Permalink to &quot;Step 6. Decomm the old tenant&quot;">​</a></h3><ol><li>Remove the Azure ID. You can delete the tenant if you wish.</li></ol><p><br><br><br></p><div class="note custom-block github-alert"><p class="custom-block-title">Document information</p><p>Author: Mark Gomez <br> Date Published: 2025/07/17 <br> Date Revised: N/A <br> Version Number: 1.0</p></div>',21)]))}const p=t(i,[["render",r]]);export{u as __pageData,p as default};
